import { Session } from './../session-manager';

const CHALLENGE_PAGE = `<!DOCTYPE html><html lang="en"><head><meta charset="UTF-8"><meta name="viewport" content="width=device-width, initial-scale=1.0"><meta http-equiv="X-UA-Compatible" content="ie=edge"><title>SecureNative has blocked your request</title><style>html,body,div,span,h1,a{margin:0;padding:0;border:0;font-size:100%;font:inherit;vertical-align:baseline}body{background:#f7f8fb;display:-webkit-box;display:-ms-flexbox;display:flex;-webkit-box-pack:center;-ms-flex-pack:center;justify-content:center;-webkit-box-align:center;-ms-flex-align:center;align-items:center;-ms-flex-line-pack:center;align-content:center;width:100%;min-height:100vh;line-height:1}svg,h1,p{display:block}svg{margin:0 auto 4vh}h1{font-family:'Proxima Nova',sans-serif;font-weight:300;font-size:34px;color:#f91e1e;line-height:normal}p{font-size:18px;line-height:normal;color:#9ea1aa;font-family:sans-serif;font-weight:300}.flex{text-align:center}</style></head><body><div class="flex"><svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="250pt" height="250pt" viewBox="0 0 250 250" version="1.1"> <defs> <image id="image5" width="1179" height="1179" xlink:href="data:image/png;base64,"/> </defs> <g id="surface2"> <use xlink:href="#image5" transform="matrix(0.212044,0,0,0.212044,0,0)"/> </g> </svg><h1>Aw Snap! We need to verify that you are human! </h1><p>Completing CAPTCHA proves you are a human and gives you access to the application</p></div></body></html>`;

export default class ChallengeRequest {
  constructor() { }

  apply(session: Session) {
    if (session.res && session.res.sn_finished) {
      return;
    }
    if (session.res) {
      session.res.writeHead(200);
      session.res.write(CHALLENGE_PAGE);
      session.res.end();
      session.res.sn_finished = true;
    }
  }
}
